function App() {

  // using our `GlobalState`
  const [count, setCount] = useGlobalState('login');

  return (
    <BrowserRouter>
      <Navbar />
      <Routes>
        <Route index element={<Content />} />
        <Route path="/detail/:id/:slug" element={<ProductDetail />} />
        {/* <Route path="/admin" element={<ProductDetail />} /> */}
        {/* <Route path="*" element={<NoPage />} /> */}
      </Routes>

    </BrowserRouter>
  );
}

export default App;
